import React from 'react';

class CountLabel extends React.Component{
    constructor(props){
        super(props);
    }

    render() {
        if(this.props.count){
            return(
                <span className={this.props.cssClasses}>{this.props.prefix} {this.props.count} {this.props.postfix}</span>
            );
        }
        return "";
    }
}

export default CountLabel;
